const fs = require('fs');
const path = require('path');

const assetsDir = path.resolve(__dirname, '..', 'assets');

const icons = [
  {
    filename: 'icon.png',
    base64: ``,
  },
  {
    filename: 'icon.ico',
    base64: ``,
  },
  {
    filename: 'icon.icns',
    base64: ``,
  },
];

function ensureDir(dir) {
  if (!fs.existsSync(dir)) {
    fs.mkdirSync(dir, { recursive: true });
  }
}

function writeIcon({ filename, base64 }) {
  const targetPath = path.join(assetsDir, filename);
  const buffer = Buffer.from(base64, 'base64');
  const existing = fs.existsSync(targetPath) ? fs.readFileSync(targetPath) : null;

  if (!existing || !existing.equals(buffer)) {
    fs.writeFileSync(targetPath, buffer);
    console.log(`Wrote ${filename} to ${targetPath}`);
  } else {
    console.log(`Skipped ${filename} (already up to date)`);
  }
}

ensureDir(assetsDir);
icons.forEach(writeIcon);
